import React, { useState } from "react";
import { Link } from "react-router-dom";
// import AppBar from "@material-ui/core/AppBar";
// import Toolbar from "@material-ui/core/Toolbar";
// import Typography from "@material-ui/core/Typography";
import {
  Home as HomeIcon,
  Menu as MenuIcon,
  Close as CloseIcon,
  MoreVert as MoreIcon,
} from "@material-ui/icons";
import {
  makeStyles,
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Menu,
  MenuItem,
  Badge,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
  },
  icon: {
    marginRight: theme.spacing(2),
  },
  colorWhite: {
    color: "#FFF",
    borderColor: "#FFF",
  },
  sectionDesktop: {
    display: "none",
    [theme.breakpoints.up("md")]: {
      display: "flex",
    },
  },
  sectionMobile: {
    display: "flex",
    [theme.breakpoints.up("md")]: {
      display: "none",
    },
  },
}));

function Navbar() {
  const [click, setClick] = useState(false);
  const [mobileAnchor, setMobileAnchor] = useState(null);
  const classes = useStyles(); //MUI
  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const handleMobileMenuOpen = (event) => {
    setMobileAnchor(event.currentTarget);
  };
  const handleMobileMenuClose = (event) => {
    setMobileAnchor(null);
  };
  const isMobileMenuOpen = Boolean(mobileAnchor);

  const renderMobileMenu = (
    <Menu
      anchorEl={mobileAnchor}
      anchorOrigin={{ vertical: "top", horizontal: "right" }}
      id="primary-search-account-menu-mobile"
      keepMounted
      transformOrigin={{ vertical: "top", horizontal: "right" }}
      open={isMobileMenuOpen}
      onClose={handleMobileMenuClose}
    >
      <MenuItem>
        <Typography>Search Bikes</Typography>
      </MenuItem>
      {/* <MenuItem>
        <IconButton aria-label="show 11 new notifications" color="inherit">
          <Badge badgeContent={11} color="secondary">
            <NotificationsIcon />
          </Badge>
        </IconButton>
        <p>Notifications</p>
      </MenuItem>
      <MenuItem onClick={handleProfileMenuOpen}>
        <IconButton
          aria-label="account of current user"
          aria-controls="primary-search-account-menu"
          aria-haspopup="true"
          color="inherit"
        >
          <AccountCircle />
        </IconButton>
        <p>Profile</p>
      </MenuItem> */}
    </Menu>
  );

  return (
    <>
      <nav className="navbar">
        <div className="navbar-container">
          <Link to="/" className="navbar-logo">
            <HomeIcon /> BPD
          </Link>
          <div className="menu-icon" onClick={handleClick}>
            {click ? <CloseIcon /> : <MenuIcon />}
          </div>
          <ul className={click ? "nav-menu active" : "nav-menu"}>
            <li className="nav-item">
              <Link to="/" className="nav-links" onClick={closeMobileMenu}>
                Search Bikes
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/" className="nav-links" onClick={closeMobileMenu}>
                About
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/" className="nav-links" onClick={closeMobileMenu}>
                Help
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/" className="nav-links" onClick={closeMobileMenu}>
                Login
              </Link>
            </li>
          </ul>
        </div>
      </nav>

      {/* //This is for material-ui implemenation */}

      <AppBar position="relative">
        <Toolbar>
          <HomeIcon className={classes.icon} />
          <Typography variant="h6" color="inherit" noWrap>
            BPD
          </Typography>
          <div className={classes.grow} />
          <div className={classes.sectionDesktop}>
            <Button className={classes.colorWhite}>Search Bikes</Button>
            <Button className={classes.colorWhite}>About</Button>
            <Button className={classes.colorWhite}>Help</Button>
            <Button className={classes.colorWhite} variant="outlined">
              Login
            </Button>
          </div>
          <div className={classes.sectionMobile}>
            <IconButton
              aria-label="show more"
              aria-controls="primary-search-account-menu-mobile"
              aria-haspopup="true"
              onClick={handleMobileMenuOpen}
              color="inherit"
            >
              <MoreIcon />
            </IconButton>
          </div>
        </Toolbar>
      </AppBar>
      {renderMobileMenu}
    </>
  );
}

export default Navbar;
